import React from 'react'

import Held from './Held'
import Sprites from './Sprites'

const Pokemon = ({ pokemon }) => {
    return (
        <div>
            <Sprites sprites={pokemon.sprites}/>
            <Held />
        </div>
    )
}

export default Pokemon
